private boolean isPluginDuplicate(Map<String, ResourcePlugin> pluginMap,
    String resourceName) {
  if (pluginMap.containsKey(resourceName)) {
    LOG.warn("Ignoring duplicate Resource plugin definition: " +
        resourceName);
    return true;
  }
  return false;
}
